import React from 'react';


const Rank = () => {
    return (
        <div>
        <div className='f3 white'>
        {'Can, your current rank is...'}
        </div>
        <div className='f1 white'>
        {'#2'}
        </div>
        </div>
    )
}

export default Rank;
